export const mvoeDir = (id, target) => `
    mutation{
        deleteDir(ids:[${ids.join(",")}])
    }
`

export const movePlaylist = (id, target) => `
    mutation{
        movePlaylist(id: ${id} target: ${target}])
    }
`


export default {
    moveDir,
    movePlaylist,
}
